import React from 'react'
import UnitColumn from './UnitColumn'
import combatValues from "../data/factions.json"

function DiceRollerPage() {
  return (
    <UnitColumn unit="Cruiser" combat={combatValues[0].combat.Cruiser}></UnitColumn>
  )
}

export default DiceRollerPage
